import react from 'react';
import {StyleSheet} from 'react-native';

const EstilosTextos = StyleSheet.create({
    tituloMenu: {
        fontSize: 50,
        color: '#f57542'

    },
    caixaBanner:{
        color:'Blue',
        fontWeight: 'bold',
        fontSize: 30
    },

    fundoTela: {
    backgroundColor: 'red'
    }
});   

export default EstilosTextos;
